function doDate()
{
   var str = 0;
   var now = new Date();
   str = now.getSeconds();
   if(str%10 == 1) one();
   if(str%10 == 2) two();
   if(str%10 == 3) three();
   if(str%10 == 4) four();
   if(str%10 == 5) five();
   if(str%10 == 6) six();
   if(str%10 == 7) seven();
   if(str%10 == 8) eight();
   if(str%10 == 9) nine();
   if(str%10 == 0) zero();
   console.log(str);
}

setInterval(doDate, 1000);
